import React from 'react';
import Footer from '../../Footer/Footer';
import Header from '../Header';
 import './Gallery.css'
 import { AiFillHeart } from "react-icons/ai";

function Gallery() {
  return (
    <>
      <Header />
      
      <div className="box-main">

        <div className="text-icon">
        <AiFillHeart/>
            <span> محبوب </span>
        </div>

        <div className="text-icon">
        <AiFillHeart/>
            <span> محبوب </span>
        </div>
      </div>

      <Footer />
    </>
  );
}

export default Gallery;
